import React, { } from 'react';
import {
  Link, Route, Switch
} from "react-router-dom";

import SwitchComp from './components/switch';

function App() {

  return (

    <div className="App">
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/contentdatas">ContentDatas</Link>
      </li>
      <li>
        <Link to="/comments">Comment</Link>
      </li>
      <li>
        <Link to="/contacts">Contact</Link>
      </li>
      <li>
        <Link to="/useradmin">Useradmin</Link>
      </li>
      <li>
        <Link to="/errors">Errors</Link>
      </li>

      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/contentdatas">
          <ContentDatas />
        </Route>
        <Route path="/comments">
          <Comments />
        </Route>
        <Route path="/contacts">
          <Contacts />
        </Route>
        <Route path="/useradmin">
          <UserAdmin />
        </Route>
        <Route path="/errors">
          <Errors />
        </Route>

      </Switch>
    </div >

  );
}



export default App;


function Home() {
  return <h2>Home</h2>;
}
function ContentDatas() {
  return <h2>ContentData</h2>;
}

function Comments() {
  return <h2>Comment</h2>;
}

function Contacts() {
  return <h2>Contact</h2>;
}
function Errors() {
  return <h2>ErrorCatch</h2>;
}
function UserAdmin() {
  return <h2>User</h2>;
}


